function dig(pl){
	if(g[pl.gX][pl.gY]!=9){g[pl.gX][pl.gY]=0;}
	if(g[pl.gX-1][pl.gY]!=9){g[pl.gX-1][pl.gY]=0;}
	if(g[pl.gX+1][pl.gY]!=9){g[pl.gX+1][pl.gY]=0;}
	if(g[pl.gX][pl.gY+1]!=9){g[pl.gX][pl.gY+1]=0;}
	if(g[pl.gX][pl.gY-1]!=9){g[pl.gX][pl.gY-1]=0;}
}
function kill(pl){
	pl.gX=pl.spawnX;
	pl.gY=pl.spawnY;
	pl.xSpeed=0;
	pl.ySpeed=0;
	pl.x=pl.gX*p;
	pl.y=pl.gY*p;
	resetGame();
}
function physFrame(){//low framerate, the speed at which the physics operate
	//console.time("1");
	
	for(ti=0;ti<time;ti++){//sets the 'speed' of the game.  1=iteration, 0=paused, 2=2x speed
		brain();
	}
	//console.timeEnd("1");
	drawGrid();
	//clearCanvas(c2);
	drawPlayers();
}
function scroll(X,Y){
	drawX+=X;
	drawY+=Y;
	if(drawX<0){drawX=0};
	if(drawX>gW-drawW){drawX=gW-drawW};
	if(drawY<0){drawY=0};
	if(drawY>gH-drawH){drawY=gH-drawH};
	drawGrid();
}
function everyFrame(){//high framerate, the speed at which the UI operates
	for(ti=0;ti<time;ti++){//sets the 'speed' of the game.  1=iteration, 0=paused, 2=2x speed
		doPlayers();
		doBullets();
		if(averagePlayerX/p>drawX+90&&drawX+drawW<gW){scroll(1,0);}//right
		if(averagePlayerX/p<drawX+60&&drawX>0){scroll(-1,0);}//left
		if(averagePlayerY/p>drawY+53&&drawY+drawH<gH){scroll(0,1);}//down
		if(averagePlayerY/p<drawY+41&&drawY>0){scroll(0,-1);}//up
	}
	if(time==0){
		if(charArray[38]){scroll(0,-1);}//up
		if(charArray[40]){scroll(0,1);}//down
		if(charArray[37]){scroll(-1,0);}//left
		if(charArray[39]){scroll(1,0);}//right
	}
	

	clearCanvas(c2);
	drawPlayers();
	drawBullets();
	doMouse();
}
function doMouse(){
	if(mouseDown){//mouse click draws pixels
		var x1 = Math.floor((cursorX-crect.left)/p)+drawX;
		var y1 = Math.floor((cursorY-crect.top)/p)+drawY;
		createRect(x1-brushSize,y1-brushSize,brushSize*2,brushSize*2,brush);
	}
}
function createRect(x1,y1,width,height,t){
	for(var l=x1;l<=x1+width;l++){//these loops draw a large area around the mouse for large brush sizes
		for(var h=y1;h<=y1+height;h++){
			if(l>=0&&l<=gW&&h>=0&&h<=gH){
				g[l][h]=t;
			}
		}
	}
}
function drawRect(col,X,Y,cnvs){//cnvs=which canvas to draw on.  defaults to the middle grid layer
	cnvs.fillStyle=col;
	cnvs.fillRect((X-drawX)*p,(Y-drawY)*p,pRender,pRender);
}
function initPlayer(pl){
	pl.x=pl.spawnX*p;
	pl.y=pl.spawnY*p;
	pl.gX=spawnX;
	pl.gY=spawnY;
}
function toggleGrid(){
	if(gridWidth==2){gridWidth=0}else{
		if(gridWidth==1){gridWidth=2};
		if(gridWidth==0){gridWidth=1};
	}
	pRender=p-gridWidth;
}
function setBrush(b){
	brush=b;
	drawHud();
}
function setBrushSize(s){
	if(s<0){s=0}
	brushSize=s;
	drawHud();
}
function drawHud(){
	hudx.fillStyle=b=block[0].color;
	hudx.fillRect(0,0,20,20);
	var s=brushSize+1;
	hudx.fillStyle=block[brush].color;
	hudx.fillRect(10-s,10-s,s*2,s*2);
	hud.style.bordercolor= block[brush].color;
}
function clearMap(){
	for(w in g){
		for(h in g[w]){
			g[w][h]=0;
		}
	}
}
function createGlider(X,Y){
	g[X][Y-1]=1;
	g[X-1][Y]=1;
	g[X-1][Y+1]=1;
	g[X][Y+1]=1;
	g[X+1][Y+1]=1;
}

document.onmousemove = function(e){
    cursorX = e.pageX;
    cursorY = e.pageY;
}
document.body.onmousedown = function() { 
    mouseDown = 1;
}
document.body.onmouseup = function() {
    mouseDown = 0;
}

window.addEventListener("keydown", checkKeyPressed, false);
window.addEventListener("keyup", checkKeyUp, false);
 

function checkKeyPressed(e) {
	var ch = e.which;
	charArray[ch]=true;
	console.log(ch);
	
    if (ch == "32") {//spacebar toogles the speed, pauses the game and sets the border size
        if(time==1){time=0;gridWidth=1;pRender=p-gridWidth;}else{time=1;gridWidth=0;pRender=p-gridWidth;}
    }
	
	if(ch=="220"){//save map  "\"
		var m=gW+","+gH+","+spawnX+","+spawnY+","+g.toString(); 
		console.log(m)
	}
	
	if(ch=="221"){//load map  "]"
		
	}
	
	if(ch==17){createGlider(Math.floor(cursorX/p)+drawX,Math.floor(cursorY/p)+drawY);}
	
	for(i in players){
		var pl=players[i];
		if(charArray[pl.keyDig]==true){dig(pl);}//dig
	}
	
	if(ch=="20"){//action key
		/*sand
		g[players[1].gX-1][players[1].gY+1]=4;
		g[players[1].gX+1][players[1].gY+1]=4;
		g[players[1].gX][players[1].gY+1]=4;
		*/
	}
	if(ch=="188"){//SAND
		//dig(players[0]);
		/*
		g[players[0].gX+1][players[0].gY+1]=4;
		g[players[0].gX-1][players[0].gY+1]=4;
		g[players[0].gX][players[0].gY+1]=4;
		*/
	}
	
	if(ch=="71"){toggleGrid();}
	if(ch=="61"||ch=="187"){setBrushSize(brushSize+1);}
	if(ch=="173"||ch=="189"){setBrushSize(brushSize-1);}
	//if(ch=="67"){clearMap()};
	
	if(ch=="192"){setBrush(0);}//air
	if(ch=="49"){setBrush(1);}//conways
	if(ch=="50"){setBrush(2);}//fertilizer
	if(ch=="51"){setBrush(3);}//ground
	if(ch=="52"){setBrush(4);}//sand
	if(ch=="53"){setBrush(5);}//DEATH
	if(ch=="54"){setBrush(6);}//water
	if(ch=="55"){setBrush(7);}//fire
	if(ch=="56"){setBrush(8);}//lava
	if(ch=="57"){setBrush(9);}//rock
}
function checkKeyUp(e) {
	var ch = e.which;
	charArray[ch]=false;
	//alert(ch);
}
